  \"2016-07-27T22:20:55.652899\",\n\t\"name\": \"final-environmental-assessment-fisheries-and-lake-rehabilitation-plan-on-st-vincent-nation\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish and Wildlife Service proposes
  to initiate actions to rehabilitate the St. Vincent Island freshwater fishery and
  lake/marsh system. Five of the island's six lakes suffered a severe fish kill September,
  1985 following Hurricane Elena. Rehabilitation actions will include mechanical manipulation
  of cattails along the edges of at least Oyster Pond (cattails will be pushed out
  of the pond edges with a tractor and blade). Normal maintenance actions such as
  drawdowns, prescribed burning, fish restocking, and chemical control of pest plants
  are also proposed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
